const getNewValue = (values, prevValue, fieldIndex, index) => {
    if(index >= fieldIndex) {
        return values[index] ? values[index] : prevValue;
    } else {
        return prevValue;
    }
}

const setClipboardValues = (fields, values, fieldIndex) => {
    let newFieldValues = {};
    let counter = -1;
    Object.keys(fields).map((field_key, index) => {
        newFieldValues = {
            ...newFieldValues,
            [field_key]: (index >= fieldIndex) ? getNewValue(values, fields[field_key], fieldIndex, index, ++counter) : fields[field_key],
        }
        return field_key;
    });
    return newFieldValues;
}

const ProjectUtil = {
    setClipboardValues
}

export default ProjectUtil;
